import React from 'react';
import ProjectCard from '../Components/ProjectCard';

const Projects = () => {
  const projects = [
    {
      title: "ExternIT - Graduation Project",
      description: "A task outsourcing platform connecting university students with companies for freelance-style work opportunities. Led the project from concept to implementation, coordinating team tasks and ensuring timely delivery.",
      image: "https://images.unsplash.com/photo-1551288049-bebda4e38f71?w=500&h=300&fit=crop",
      tags: ["PHP", "JavaScript", "CSS", "Bootstrap", "phpMyAdmin"],
      link: "https://docs.google.com/document/d/1DtnTie8enbOdJtZtVfyqS0xK-PZ-6pb3/edit?usp=drive_link&ouid=100744939960500774497&rtpof=true&sd=true",
      github: null
    },
    {
      title: "Casa.kt Desktop Application",
      description: "Complete desktop application for furniture and kitchen manufacturing company. Developed using Electron, React, and Node.js with MongoDB integration, featuring professional PDF reports and streamlined workflows.",
      image: "https://images.unsplash.com/photo-1556742049-0cfed4f6a45d?w=500&h=300&fit=crop",
      tags: ["Electron", "React", "Node.js", "MongoDB", "PDF Generation"],
      link: null,
      github: null
    },
    {
      title: "USAM Website Redesign",
      description: "Collaborative redesign project for an EdTech and career platform for Arab students and professionals. Worked with the team to create an improved user experience and modern design.",
      image: "https://images.unsplash.com/photo-1467232004584-a241de8bcf5d?w=500&h=300&fit=crop",
      tags: ["UI/UX Design", "Web Design", "Collaboration", "EdTech"],
      link: null,
      github: null
    },
    {
      title: "Personal Portfolio",
      description: "Modern portfolio website showcasing my work with glassmorphism design and smooth interactions. Built with React and featuring responsive design principles.",
      image: "https://images.unsplash.com/photo-1565299624946-b28f40a0ca4b?w=500&h=300&fit=crop",
      tags: ["React", "CSS3", "JavaScript", "Responsive Design", "Glassmorphism"],
      link: "https://sites.google.com/view/abdelrahman-elshurbagy/home",
      github: null
    }
  ];

  return (
    <div className="projects-page">
      <div className="projects-container">
        <div className="projects-header">
          <h1 className="projects-title">My Projects</h1>
          <p className="projects-description">
            A collection of my recent work in UI/UX design and front-end development. 
            Each project represents a unique challenge and learning opportunity.
          </p>
        </div>
        
        <div className="projects-grid">
          {projects.map((project, index) => (
            <ProjectCard key={index} project={project} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default Projects;
